    false,nt"url": null,nt"notes": "This dataset is a single orthophoto from
    a collection of GeoTIFF format, natural-color orthophotos covering Collier County,
    Florida. The dataset covers an area of approximately 14.3 square miles. An orthophoto
    is remotely sensed image data in which displacement of features in the image caused
    by terrain relief and sensor orientation have been mathematicallyremoved. Orthophotography
    combines the image characteristics of a photograph with the geometric qualities
    of a map. Each orthophoto provides imagery for a 5000- by 5000-foot block on the
    ground at 2.0 foot pixel resolution. The projected coordinate system is State Plane,
    Florida East (FIPS 901), NAD83, Survey Feet. There is no image overlap in adjacent
    files. The imagery was captured using the Zeiss/Intergraph Digital Mapping Camera
    (DMC). The USGS National Elevation Data (NED) was used as a DEM surface for the
    orthorectification process. The orthophotos are available in GeoTIFF and MrSID compressed
    forms.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
